function Animal() { }
Animal.prototype.eat = function() { console.log("nom nom nom"); };

function Dog() { }
Dog.prototype = Object.create(Animal.prototype);
Dog.prototype.constructor = Dog;
// inherits properties of supertype Animal

Dog.prototype.bark = function() { 
    console.log("Woof!");
} // property for Dog is bark 

// beagle will instantiate new object of constructor Dog

